import React from 'react'

function About() {
    return (
     
        <div className="aboutContainer">
            {/* For title */}
        <div className="title">
        <h1>About the project</h1>
        </div>

           {/* For content  */}
            <div className="content">
                <h3>This is the model of Sentiment Analysis which gives the rating. <br/>where rating '1' denotes
                as negative and '5' denotes as positive. </h3>
            </div>
        {/* For rating */}
        <div className="rating">

        </div>

        {/* Our info */}
        <div className="info">

        </div>

            
        </div>
        
    )
}

export default About
